商品名：ジューシィクレンズ　ボディソルト　グリーン<br>内容量：300g<br>ブランド：ジューシィクレンズ<br>原産国：日本<br><br>スッキリ美脚＆つるつるボディの塩スクラブ<br>スッキリ美脚＆つるつるボディに導く、ジューシィ果実の塩スクラブシリーズ。コールドプレス製法のアルガンオイルと４種のフルーツ＆ベジタブルエキス配合。<br>使用方法：●お肌を傷めないようにやさしくマッサージしてください。●顔や粘膜には使用しないでください。\n●お肌に異常が生じていないかよく注意して使用してください。●傷、はれもの、湿疹等、異常のある時は使わないでください。●使用中や使用後日光にあたって、赤み、はれ、かゆみ、刺激、色抜け（白斑等）や黒ずみ等の異常があらわれた時は使用をやめ、皮フ科専門医等へご相談をおすすめします。使用を続けますと悪化することがあります。●目に入った時は、直ちに洗い流してください。●使用後は必ずしっかりキャップをしめてください。●乳幼児の<br><br>JANコード:4901234394513<br><br><br>商品番号：101-26081<br><br><br><br><br><br>区分：化粧品<br><br>発売元、製造元、輸入元又は販売元： 株式会社ウテナ<BR><BR>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
